import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';



const root = ReactDOM.createRoot(document.getElementById('root'));
let name = "Богдан";
let surname = "Чудопалов"
const items = ['Элемент 1', 'Элемент 2', 'Элемент 3', 'Элемент 4', 'Элемент 5', 'Элемент 6'];
root.render(
  <div>
    <h1>Какое-то значение</h1>
    <h2>{name} {surname}</h2>
    <ul>
      <li> {items[0]}</li>
      <li>{items[1]}</li>
      <li>{items[2]}</li>
      <li>{items[3]}</li>
      <li>{items[4]}</li>
      <li>{items[5]}</li>
    </ul>
  </div>
);
